import axios from 'axios'
import React from 'react'
import { useState } from 'react'
import { useEffect } from 'react'
function Homescreen() {
          useEffect(async()=>{
              try{
                    const data=(await axios.get('./api/rooms/getallrooms')).data
                    console.log(data);
              }catch(error){
                  console.log(error);
              }
          },[])
  return (
    <div>
          <h1>Homescreen</h1>
    </div>
  )
}

export default Homescreen
